const Footer = () => {
    return (
        <footer>
            <div>
                <h3>LOS ANGELES</h3>
                <ul>
                    <li>145 Oliveshka Street, Los Angeles, LA 90003</li>
                    <li>+44 987 065 901</li>
                    <li>info@Example.com</li>
                </ul>
            </div>
        </footer>
    );
}


export default Footer;
